import React, { Component } from 'react';
import './App.css';
import Header from "./componenet/Header"
import Section from "./componenet/Section"
import { BrowserRouter as Router } from "react-router-dom"

function App() {
  return (
    <Router>
      <div>
        <Header />
        <Section />
      </div>
    </Router>
  );
}

export default App;
